  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 9056 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '审计日志明细表' ROW_FORMAT = Dynamic;

